import React, { useState } from "react";

const BookViewer = () => {
  const [isbn, setIsbn] = useState();
  console.log(isbn);
  const searchBook = () => {};
  return (
    <div id="viewerCanvas">
      Google Books Api App
      <form>
        <input
          type="text"
          onChange={(e) => setIsbn(e.target.value)}
          placeholder="enter isbn number"
          onSubmit={searchBook}
        />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default BookViewer;
